void skip_comment(void)
{
    register int c;

    for (;;)
    {
        c = getc(yyin);

        if (c == '\n')
        {
            if (run_parse_mode == 2)
            ++line_num;
            continue;
        }
        else if (c == '*')
        {
            for (;;)
            {
                c = getc(yyin);
                if (c == '/') {
                    return;
                    break;  /* found the end */
                }
                else if (c == EOF)
                {
                    yyerror("EOF in comment");
                    break;
                }
                else continue;
            }

            if (c == '\n')
            {
                if (run_parse_mode == 2)
                ++line_num;
                continue;
            }
            if (c == '/') {
                ++line_num;
                break;
            }
            if (c == EOF)
            {
                yyerror("EOF in comment");
                break;
            }
        }
        else if (c == EOF)
        {
            yyerror("EOF in comment");
            break;
        }
    }
}

